export const LogoGradientButton = ({ gradientFrom, gradientTo }) => {
	// For example, choose a color based on the color scheme:
	// const svgColor = theme.colors.violet[6];
	return (
		<ThemeIcon
			radius="xl"
			size="lg"
			variant="default"
			style={{ backgroundColor: "transparent" }}
		>
			<GradientLogo gradientFrom={gradientFrom} gradientTo={gradientTo} />
		</ThemeIcon>
	);
};

interface LogoButtonProps {
	color?: string;
}

export const LogoButton = ({ color }: LogoButtonProps) => {
	return (
		<ThemeIcon
			radius="xl"
			size="lg"
			variant="default"
			style={{ backgroundColor: "transparent" }}
		>
			<Logo color={color} />
		</ThemeIcon>
	);
};

